        self.sequence = buf.readInt64()
        self.savedHandle = TPM_HANDLE.fromTpm(buf)
        self.hierarchy = TPM_HANDLE.fromTpm(buf)
        self.contextBlob = buf.createSizedObj(TPMS_CONTEXT_DATA)

